function t=sbe3cal(f);% SBE3 TEMPERATURE PROBE CALIBRATION EQUATION%function t=sbe3cal(f);%TEST clear, nargin=1; f=12000% SBE CAL -- JAN 2000g=4.82525811e-3; h=6.80180724e-4; i=2.99332927e-5; j=2.70033788e-6; f0=1000;if nargin == 0%ORIGINAL CALIBRATION VALUES% 	f=[% 		6057.572% 		6416.333% 		6942.064% 		7487.371% 		8062.011% 		8677.256% 		9306.784% 		9974.753% 		10680.624% 		11408.035% 		12169.493];	fprintf('Calibration check on SBE3 calibration\n');		f=[6000:100:13100]';end% SBE CALIBRATION EQUATIONx=log(f0 ./ f);t =g + h .* x + i .* x.*x + j .* x.*x.*x;t = (1 ./ t) - 273.15;% PRNT OUT RESULTS AS A TABLEif nargin == 0	for i = 1:36		fprintf('%5d  %9.3f             %5d %9.3f\n',f(i),t(i),f(36+i),t(36+i));	endendreturn;